import React from "react";
import location from "../../image/location.png";
import "./content.css";
function Preview() {
  return (
    <div className="preview__bg">
      <div className="container">
        <div className="preview__location">
          <img src={location} alt="404" />
          <span>Днепр</span>
        </div>
        <ul className="preview_list"></ul>
        <div className="preview__groups"></div>
        <div className="preview__profile"></div>
      </div>
    </div>
  );
}

export default Preview;
